import React from 'react'
import '../App.css'
const Signup = () => {
    return ( 
        <div className="myc">
          <div className="card auth-card">
           <h2>Myapp</h2>
            <input type="text"
            placeholder="email" />
              <input type="text"
            placeholder="password" />
             <button className="btn waves-effect waves-light" >Signup</button>
            </div>
            </div>
         
     );
}
 
export default Signup;
